.main {
  .carousel {
    position: relative;

    .q-carousel__slide {
      padding: 0;
      .overlay {
        background-color: rgba(0, 0, 0, 0.75);
        z-index: 2;
        width: 100%;
        height: 100%;
        .content {
          color: #ffffff;
        }
      }
    }

    .carousel-ribbon {
      background-color: $secondary;
      transform: rotate(-9deg);
      z-index: -2;
      position: absolute;
      height: 240px;
      width: 140%;
      left: -20%;
      top: 19%;
    }
  }
  .about {
    width: 100%;
    height: 70vh;
    position: relative;
    .profile-img {
      background-image: url(../assets/profile_1.jpg);
      background-size: cover;
      background-position: center;
      background-repeat: no-repeat;
      height: 61vh;
      width: 50vh;
    }
    .about-ribbon {
      background-color: $primary;
      z-index: -2;
      position: absolute;
      height: 100%;
      width: 78%;
      left: 22%;
    }
  }
  .description {
    height: auto;
    .col-8 {
      background-color: $secondary;
      padding: 7%;
      line-height: 2.5;
    }
  }
}
@media only screen and (max-width: 768px) {
  .main {
    .carousel {
      .text-h4 {
        margin-bottom: calc(1.33em * 2);
      }
    }
    .about {
      height: auto;
      .profile-img {
        height: 51vh;
        width: 40vh;
      }
      .profile-left {
        justify-content: center;
      }
      .profile-right {
        justify-content: center;

        .title {
          padding-left: 0;
          justify-content: center;
          text-align: center;
          .text-barcelony {
            line-height: 0.9;
          }
        }
      }
      .about-ribbon {
        left: 0;
        width: 100%;
        height: 80%;
        top: 20%;
      }
    }
    .description {
      .col-8 {
        padding: 0;
        line-height: 1.5;
      }
    }
  }
}
